import React, { Component } from "react";
import '../App.css';
import JogadorasDataService from "../services/jogadoras.service";

export default class ListaJogadoras extends Component {
	constructor(props) {
		super(props);
		this.retrieveJogadoras = this.retrieveJogadoras.bind(this);

		this.state = {
			jogadoras: [],
		};
	}

	componentDidMount() {
		this.retrieveJogadoras();
	}


	retrieveJogadoras() {
		JogadorasDataService.getAll()
			.then(response => {
				this.setState({
					jogadoras: response.data
				});
				console.log(response.data);
			})
			.catch(e => {
				console.log(e);
			});
	}

	render() {
		const { jogadoras } = this.state;

		return (

			<div>
				<div className="header m-5">
					<h1>Lista Jogadoras</h1>
				</div>
				<div className="m-5">
					<button className="btn btn-primary" type="button" data-toggle="collapse" data-target="#collapseFiltros" aria-expanded="false" aria-controls="collapseExample">
						Filtros
					</button>
					<div className="collapse m-3" id="collapseFiltros">

						<div>
							<div className="mt-2">
								<h5>Posição</h5>
							</div>
						</div>
						<div className="form-check">
							<input className="form-check-input" type="checkbox" value="" id="posicaoGOL" />
							<label className="form-check-label" for="posicaoGOL">
								Goleira
							</label>
						</div>
						<div className="form-check">
							<input className="form-check-input" type="checkbox" value="" id="posicaoLAT" />
							<label className="form-check-label" for="posicaoLAT">
								Lateral
							</label>
						</div>
						<div className="form-check">
							<input className="form-check-input" type="checkbox" value="" id="posicaoZAG" />
							<label className="form-check-label" for="posicaoZAG">
								Zagueira
							</label>
						</div>
						<div className="form-check">
							<input className="form-check-input" type="checkbox" value="" id="posicaoMEI" />
							<label className="form-check-label" for="posicaoMEI">
								Meia
							</label>
						</div>
						<div className="form-check">
							<input className="form-check-input" type="checkbox" value="" id="posicaoATA" />
							<label className="form-check-label" for="posicaoATA">
								Atacante
							</label>
						</div>

					</div>
				</div>

				<div>
					<table className="table my-3 mx-auto">
						<thead>
							<tr>
								<th scope="col">Posição</th>
								<th scope="col">Time</th>
								<th scope="col">Jogadora</th>
							</tr>
						</thead>
						<tbody>
							{jogadoras &&
								jogadoras.map((jogadoras, index) => (
									<tr>
										<td>{jogadoras.posicaoJogadora}</td>
										<td>{jogadoras.idEquipe}</td>
										<td>{jogadoras.nomeJogadora}</td>
										<td>
											<div className="btn btn-success btnPlus">+</div>
										</td>
									</tr>
								))}
						</tbody>
					</table>
				</div>
			</div>

		);
	}
}
